import {Route, Switch} from "react-router-dom";
import './App.css';
import Patient from "./Patient";
import Treatment from "./Treatment";
import NavBar from "./NavBar";

function App() {

  return (
    <div className="App">
      <header className="App-header">
      <NavBar/>
      </header>
      <main>
      <Patient/>
      <Treatment/>


      </main>
    </div>
  );
}

export default App;

